&lt;h3&gt;17mm PTH Potentiometer (Pot) with Switch&lt;/h3&gt;
&lt;p&gt;Three-terminal potentiometers, with an adjustable wiper and two adjustable resistors. A pot can be used to create a configurable voltage divider, or as a variable resistor.&lt;/p&gt;
&lt;p&gt;This potentiometer includes a &quot;select&quot; switch - actuated by pushing down on the wiper.&lt;/p&gt;
&lt;p&gt;&lt;a href=&quot;http://www.top-up.com.tw/front/bin/download.phtml?Part=16M1SHB-A&amp;Nbr=42285&amp;Category=60664&quot;&gt;Datasheet&lt;/a&gt; (Top Up 16M1SHB-B3-20KM-A2K-16Y)&lt;/p&gt;
